import 'bootstrap/dist/css/bootstrap.min.css';
import SearchmdComponent from './components/SearchmdComponent';
import NavbarComponent from './components/NavbarComponent';

function App() {
  return (
    <div className="App">
      <NavbarComponent />
      <SearchmdComponent />
    </div>
  );
}

export default App;
